import React from 'react'
import styles from "./styles.module.css";
import Button from "../Button/button";
import { useState, useEffect } from "react";
import { animated, useSpring } from "react-spring";
import { Link } from "react-router-dom";
import gif from "../loaderlogo.gif";
import Notification from "../Notification";
import axios from "axios";
import Select from "react-select";
import user from "./user.png";

const Userpro = (props) => {

    var x =localStorage.getItem("loginuser");
    x = JSON.parse(x);
    x = x.name;
    console.log(x.name);

    const styleprops = useSpring({
        from: {
          opacity: 0,
          transform: "translate(-4000px,-1000px)",
        },
        opacity: 1,
        transform: "translate(0,0)",
      });

      return (
        <>
          <animated.div style={styleprops} className={styles.box}>
            <div className={styles.signup_container}>
            <img src={user} alt="img" className={styles.image}></img>
            <h1 className={styles.textlogin}>Manav Shah</h1><br></br>
            <h1 className={styles.textlogin}>manavshah9890@gmail.com</h1>
            </div>
          </animated.div>
        </>
      );

};
export default Userpro;
